import { Navigate, Route, Routes } from "react-router-dom";
import MainPage from "./pages/mainPage";

import "App.css";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<MainPage />} />
      </Routes>
    </>
  );
}

export default App;
